import logo from "./logo.svg";
import "./App.css";
import React, { Component } from "react";

const empleadoItems = [
  {
    id_empleado: 1,
    nombre: "Luis Vasquez",
    salario_base: "10,000",
    horas_trabajadas: "40",
    estado: false,
  },
  {
    id_empleado: 2,
    nombre: "Luis Enrique",
    salario_base: "14000",
    horas_trabajadas: "40",
    estado: true,
  },
  {
    id_empleado: 3,
    nombre: "Ana Rodriguez",
    salario_base: "12500",
    horas_trabajadas: "40",
    estado: true,
  },
];

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      viewCompleted: false,
      empleadoList: empleadoItems,
    };
  }
  displayCompleted = (status) => {
    if (status) {
      return this.setState({ viewCompleted: true });
    }
    return this.setState({ viewCompleted: false });
  };
}

